import './servicePage.scss';
import { useState, useEffect, useCallback, useRef } from 'react';
import Header from '../header/header';
import ServiceItem from '../serviceItem/serviceItem';
import { Link } from 'react-router-dom';
import FadeIn from '../fadeIn/fadeIn';


const ServicePage = (): JSX.Element => {

    const [serv, setServ] = useState<number>(1);

    console.log("test");

    // const resetHeight = useCallback(() => {
    //     document.getElementById("servicePageTest")!.style.minHeight = window.innerHeight + "px";
    //     document.getElementById("servicePageTest")!.style.height = window.innerHeight + "px";
    // },[]);

    // useEffect(() => {
    //     document.getElementById("servicePageTest")!.style.minHeight = window.innerHeight + "px";
    //     document.getElementById("servicePageTest")!.style.height = window.innerHeight + "px";
    //     window.addEventListener('resize', resetHeight);
    //     return () => window.removeEventListener('resize', resetHeight);
    // }, [resetHeight]);

    return (
        <>
            <Header dark={false} />
            <div className="servicePage">
                <div className="servicePage__tiles">
                    <div className={`servicePage__tiles__wrapper ${serv === 3 ? "servicePage__tiles__wrapper--scrollUp" : ""} ${serv === 4 || serv === 5 ? "servicePage__tiles__wrapper--scrollUpUp" : ""}`}>
                        <div className={`servicePage__tiles__wrapper__tile ${serv === 1 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>Web</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serv === 2 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>App</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serv === 3 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>Cloud</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serv === 4 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>AI</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serv === 5 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>New</span></div>
                    </div>
                </div>
                <div id="servicePageTest" className="servicePage__text">
                    <FadeIn argPropActive={1} setPropActive={setServ}>
                        <div className="wrapper">
                            <ServiceItem classNameAdded="" title={<>Do you need help with builidng your website?</>} text={<>We build can build your website using technologies such as PHP or React.</>} />
                            <div className="servicePage__text__tile">
                                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 260 100" preserveAspectRatio="xMinYMid meet">
                                    <text x="0" y="82">Web</text>
                                </svg>
                            </div>
                        </div>
                    </FadeIn>
                    <FadeIn argPropActive={2} setPropActive={setServ}>
                        <ServiceItem classNameAdded="" title={<>App development</>} text={<>Is a hybrid solution better then a native solution for your organisation?<br />We can help you with building an App suited for your goals.</>} />
                        <div className="servicePage__text__tile">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 260 100" preserveAspectRatio="xMinYMid meet">
                                <text x="0" y="82">App</text>
                            </svg></div>
                    </FadeIn>
                    <FadeIn argPropActive={3} setPropActive={setServ}>
                        <ServiceItem classNameAdded="" title={<>Fascinated about the Cloud?</>} text={<>We are fascinated about the Cloud and it's possibilities. Helping organisations to make use of this potential is what we want to do.</>} />
                        <div className="servicePage__text__tile">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 260 100" preserveAspectRatio="xMinYMid meet">
                                <text x="0" y="82">Cloud</text>
                            </svg>
                        </div>
                    </FadeIn>
                    <FadeIn argPropActive={4} setPropActive={setServ}>
                        <ServiceItem classNameAdded="" title={<>Artificial intelligence</>} text={<>We help organisations use the full potential of all it's data by using AI. Is your organisation ready for it?</>} />
                        <div className="servicePage__text__tile">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 260 100" preserveAspectRatio="xMinYMid meet">
                                <text x="0" y="82">AI</text>
                            </svg>
                        </div>
                    </FadeIn>
                    <FadeIn argPropActive={5} setPropActive={setServ}>
                        <ServiceItem classNameAdded="" title={<>Unknown</>} text={
                            <div>
                                <div>
                                    <span>Looking for something new in the digital domain or need advise?</span>
                                </div>
                                <div className="newService__contact">
                                    <Link to="/contact">
                                        <span>Lets talk</span>
                                        <span></span>
                                    </Link>
                                </div>
                            </div>
                        } />
                        <div className="servicePage__text__tile">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 260 100" preserveAspectRatio="xMinYMid meet">
                                <text x="0" y="82">New</text>
                            </svg>
                        </div>
                    </FadeIn>
                </div>
            </div>
        </>
    );
}

export default ServicePage;
